    "### **1. ASK PHASE**\n",
    "\n",
    "**What is the problem we are trying to solve?**\n",
    "\n",
    "The main problem we are trying to solve is that how can we convince casual riders to switch into as annual members. What steps should we take, and which questions we should ask before we dive into the problem.\n",
    "\n",
    "**How can our insights drive business decisions?**\n",
    "\n",
    "Our insights can help to see the problem from a bigger picture. But we need to use structural thinking, which is where we need to be in a step-by-step manner. Then, we need to decide if there is any correlation or causation in this problem. Therefore, we need to think critically and creatively and ask \"**Why?**\" for **5** times to find the root cause. While doing these, we need to be communicating with our teammates.\n",
    "\n",
    "**The business task:**\n",
    "\n",
    "In this task, we will handle the issue of differences between annual members and casual riders and what are things that influences them when buying memberships and how can we improve the annual memberships' attractability. I am asked by our manager, *Moreno*, simply to point out and highlight the key findings from our databases and as well as to find digital marketing strategies to overcome these problems. She believes that maximizing the number of annual members will be key to future growth, and we are going to find out if that would be a solution. At the end of this report, a summary of this analysis will be provided.\n",
    "\n",
    "------------------------------------------------------------------------"
   ]
  },
