    "### **2. PREPARE PHASE**\n",
    "\n",
    "In this phase, Cyclistic's historical trip data from a 12 months cycle between April, 2020 and May, 2021 will be used to analyze and identify trends.\n",
    "\n",
    "**Where is our data located?**\n",
    "\n",
    "Our data is located within a cloud-based system and made available by Motivate International Inc.\n",
    "\n",
    "**How is the data organized?**\n",
    "\n",
    "Data is organized, cleaned and merged by using R to see our data from other perspectives and to create a better story by using them.\n",
    "\n",
    "**Are there issues with bias or credibility in this data?**\n",
    "\n",
    "In order to determine if the data has no bias and fully credible within, \"**ROCCC**\" system will be used. This means that whether if the data is **reliable, original, comprehensive, current,** and **cited**, will be checked.\n",
    "\n",
    "-   **Reliability:** As this data comes from an outside source, the data it is given are limited and cannot be relied upon thoroughly. But this does not mean that we cannot have assumptions from the data which we will see later.\n",
    "\n",
    "-   **Originality:** As it has been mentioned above, this is an outside source which is considered as second-party source. This data is original data, but the data is limited, and this should be considered while making decisions.\n",
    "\n",
    "-   **Comprehensiveness:** This data is not comprehensive as there is no detailed information about casual riders and annual members such as gender and age, etc. Therefore, our vision will be limited where we need to see new paths and make new strategies onwards.\n",
    "\n",
    "-   **Current:** This data is valid, and can be assumed that it is current to our date as it has been gathered between the beginning of 2013 and end of 2021.\n",
    "\n",
    "-   **Cited:** As stated before, this dataset is created by Motivate International Inc. This is all it can be cited for as there is no other information provided.\n",
    "\n",
    "The following analysis can solely provide a restricted view of from what is gathered. It would have helped us to visualize much better, if the company has had detailed information on customers.\n",
    "\n",
