   "source": [
    "tripdata_merged_all$ride_length <- difftime(tripdata_merged_all$ended_at, tripdata_merged_all$started_at)\n",
    "\n",
    "tripdata_merged_all$ride_distance <- distGeo(matrix(c(tripdata_merged_all$start_lng, tripdata_merged_all$start_lat), ncol = 2), matrix(c(tripdata_merged_all$end_lng, tripdata_merged_all$end_lat), ncol = 2))\n",
    "tripdata_merged_all$ride_distance <- tripdata_merged_all$ride_distance/1000\n",
    "\n",
    "tripdata_merged_all$ride_speed = c(tripdata_merged_all$ride_distance)/as.numeric(c(tripdata_merged_all$ride_length), units=\"hours\")"
   ]
