    "userType_min <- tripdata_merged_all %>% \n",
    "  group_by(member_casual) %>% \n",
    "  summarise(mean_time = mean(ride_length), mean_distance = mean(ride_distance))\n",
    "\n",
    "userType_max <- tripdata_merged_all %>% \n",
    "  group_by(member_casual) %>% \n",
    "  summarise(max_time = max(ride_length), max_distance = max(ride_distance))\n",
    "\n",
    "membervstime_min <- ggplot(userType_min) + \n",
    "  geom_col(mapping = aes(x = member_casual, y = mean_time, fill = member_casual), show.legend = FALSE)+\n",
    "  labs(title = \"Min. Travel Time by User Types\", x = \"User Types\", y = \"Min. time in seconds\")+\n",
    "  scale_fill_manual(values=c(\"#FFC300\", \"#3498DB\"))\n",
