   "source": [
    "with_bike_type %>%\n",
    "  group_by(member_casual, rideable_type) %>%\n",
    "  summarise(totals=n(), .groups=\"drop\")  %>%\n",
    "  ggplot()+\n",
    "  geom_col(aes(x = member_casual, y = totals, fill = rideable_type), position = \"dodge\") + \n",
    "  labs(title = \"Bike type usage by User Types\", x = \"User Types\", y =  NULL, fill = \"Bike Types\") +\n",
    "  scale_fill_manual(values = c(\"classic_bike\" = \"#A569BD\", \"electric_bike\" = \"#229954\")) +\n",
    "  theme_minimal() +\n",
    "  theme(legend.position = \"top\")"
   ]
