   "source": [
    "with_bike_type %>%\n",
    "  mutate(weekday = wday(started_at, label = TRUE)) %>% \n",
    "  group_by(member_casual, rideable_type, weekday) %>%\n",
    "  summarise(totals = n(), .groups = \"drop\") %>%\n",
    "  ggplot(aes(x = weekday,y = totals, fill = rideable_type)) +\n",
    "  geom_col(position = \"dodge\") + \n",
    "  facet_wrap(~member_casual) +\n",
    "  labs(title = \"Bike type usage by User Types during a week\", x = \"User Types\", y = NULL, caption = \"Data by Motivate International Inc\") +\n",
    "  scale_fill_manual(values = c(\"classic_bike\" = \"#A569BD\", \"electric_bike\" = \"#229954\")) +\n",
    "  theme_minimal() +\n",
    "  theme(legend.position = \"none\")"
   ]
  },
