   "source": [
    "By comparing the maximums, it can be understood that annual members are more likely to be commute riders whereas casual riders are just casual riders in the centre where they can be anyone, such as a tourist or a random local person. Annual riders are looking more determined on where they are headed, especially this can be understood even more when looking at the maps below:"
